import React from 'react';

interface QualityWarningModalProps {
  isOpen: boolean;
  onClose: () => void;
  onContinue: () => void;
  qualityIssues: string[];
  lowQualityCount: number;
  noneResponseRate?: number;
}

export default function QualityWarningModal({ 
  isOpen, 
  onClose, 
  onContinue, 
  qualityIssues, 
  lowQualityCount,
  noneResponseRate = 0
}: QualityWarningModalProps) {
  if (!isOpen) return null;

  const isNoneProblem = noneResponseRate >= 30;

  return (
    <div className="fixed inset-0 bg-black/50 backdrop-blur-sm z-50 flex items-center justify-center p-4">
      <div 
        className="max-w-lg mx-auto rounded-2xl shadow-2xl p-6 animate-bounce-in"
        style={{ backgroundColor: 'var(--bg-card)' }}
      >
        {/* Header */}
        <div className="text-center mb-6">
          <div className="text-5xl mb-3">{isNoneProblem ? 'üö®' : 'ü§î'}</div>
          <h2 
            className="text-2xl font-bold mb-2"
            style={{ color: 'var(--text-primary)' }}
          >
            {isNoneProblem ? 'Response Pattern Alert' : 'Response Quality Check'}
          </h2>
          <p 
            className="text-sm"
            style={{ color: 'var(--text-secondary)' }}
          >
            We want to help you provide valuable cultural insights
          </p>
        </div>

        {/* Content */}
        <div 
          className="p-4 rounded-xl mb-6"
          style={{ 
            background: isNoneProblem ? '#fef2f2' : 'var(--btn-warning-bg)',
            border: `1px solid ${isNoneProblem ? '#fca5a5' : '#fbbf24'}`
          }}
        >
          <div className="flex items-start">
            <span className={`mr-3 text-xl ${isNoneProblem ? 'text-red-600' : 'text-orange-600'}`}>
              {isNoneProblem ? '‚ö†Ô∏è' : 'üí°'}
            </span>
            <div>
              {isNoneProblem ? (
                <>
                  <p 
                    className="font-medium mb-2"
                    style={{ color: '#dc2626' }}
                  >
                    We've noticed you're answering "none" or "don't know" to {noneResponseRate.toFixed(0)}% of questions.
                  </p>
                  <p 
                    className="text-sm mb-3"
                    style={{ color: '#dc2626' }}
                  >
                    Even if practices vary, you likely have some knowledge about cultural norms in your region. 
                    Please try to share what you do know, even if it's different or less common.
                  </p>
                </>
              ) : (
                <>
                  <p 
                    className="font-medium mb-2"
                    style={{ color: '#92400e' }}
                  >
                    Your response could be more informative for our cultural research.
                  </p>
                  <p 
                    className="text-sm mb-3"
                    style={{ color: '#92400e' }}
                  >
                    Please provide specific details about cultural practices in your region.
                  </p>
                </>
              )}

              {qualityIssues.length > 0 && (
                <div className="text-xs" style={{ color: isNoneProblem ? '#dc2626' : '#92400e' }}>
                  <p className="font-medium mb-1">Issues detected:</p>
                  <ul className="list-disc list-inside space-y-1 ml-2">
                    {qualityIssues.slice(0, 3).map((issue, index) => (
                      <li key={index}>{issue}</li>
                    ))}
                  </ul>
                </div>
              )}
            </div>
          </div>
        </div>

        {/* Better Response Tips */}
        <div 
          className="p-4 rounded-xl mb-6"
          style={{ 
            background: 'var(--tag-category-bg)',
            border: '1px solid var(--border-light)'
          }}
        >
          <h3 
            className="font-medium mb-2 text-sm"
            style={{ color: 'var(--text-primary)' }}
          >
            üí° Instead of "none" or "don't know", try:
          </h3>
          <ul 
            className="text-xs space-y-1"
            style={{ color: 'var(--text-secondary)' }}
          >
            <li>‚Ä¢ "In my region, we typically..." or "Usually people here..."</li>
            <li>‚Ä¢ "This isn't common in my area, but some people..."</li>
            <li>‚Ä¢ "From what I've observed..." or "Based on my experience..."</li>
            <li>‚Ä¢ "This varies, but generally..." or "It depends, but often..."</li>
            <li>‚Ä¢ "While not universal, many people in my area..."</li>
          </ul>
        </div>

        {/* Buttons */}
        <div className="flex space-x-3">
          <button
            onClick={onClose}
            className="flex-1 px-4 py-3 font-medium rounded-xl transition-all duration-200"
            style={{ 
              background: 'var(--btn-secondary-bg)',
              color: 'var(--text-on-dark)'
            }}
          >
            Let Me Improve My Answer
          </button>
          
          <button
            onClick={onContinue}
            className="flex-1 px-4 py-3 font-medium rounded-xl transition-all duration-200"
            style={{ 
              background: 'var(--btn-warning-bg)',
              color: '#92400e'
            }}
          >
            Continue As Is
          </button>
        </div>

        {isNoneProblem && (
          <div className="mt-4 text-center">
            <p 
              className="text-xs"
              style={{ color: 'var(--text-muted)' }}
            >
              Your cultural knowledge is valuable! Even small details about your region 
              help preserve and understand India's diverse traditions.
            </p>
          </div>
        )}
      </div>
    </div>
  );
}
